sys_variable_value.value:
(function execute(inputs, outputs) {

  if (inputs.account_id.match(/0\.0\.[0-9]+/)) {
    gr = new GlideRecord("x_snc_hconnector_account")
    gr.initialize()
    if (inputs.account_name) {
      gr.name = inputs.account_name      
    } else {
      gr.name = inputs.account_id 
    }
    gr.account_id = inputs.account_id
    gr.insert()
  } else {
    throw("No account_id")
  }

})(inputs, outputs);

